import React from 'react';
import LForm from '../components/LForm'


import diskJockey from '../images/onesandtwos.jpg'

const styles = {
  Center: {
    textAlign: 'center',
    justifyContent: 'center',
    alignItems: 'center',
    background: 'linear-gradient(#3F5EFB 0%, #FC466B 100%)'
  },
  Space: {
    padding: '10px'
  },
  Disk: {
    borderStyle: 'solid',
    borderRadius: '5px'
  }
}

export default function Login() {
  return (
    <div style={styles.Center}>
      <div className="row" style={styles.Space}></div>
      <div className="row">
        <img src={diskJockey} alt="dj" style={styles.Disk} />
      </div>
      <div className="row">        
      </div>
      <LForm />
    </div>
  )
};
